import React from 'react';
import { View } from 'react-native';
import SwipeCards from 'react-native-swipe-cards';
import Card from './components/organisms/Card';
import NoMoreCards from './components/molecules/NoMoreCards';

const cards = [
  {
    id: 1,
    name: 'Cristian Ronaldo',
    age: 25,
    pictures: ['https://img.freepik.com/free-photo/real-people-natural-portrait-happy-guy-smiling-laughing-looking-upbeat-camera-standing-glasses-white-background_1258-65662.jpg?t=st=1714045351~exp=1714048951~hmac=f38443fccfd9a7a598d4d5b7ea7e1f17663db57da23373ae153c1633cd229856&w=1380', 'https://img.freepik.com/premium-photo/image-happy-grateful-young-asian-woman-gothic-lace-dress-clasp-hands-together-say-thank_1258-114050.jpg?w=1480', 'https://img.freepik.com/premium-photo/image-happy-grateful-young-asian-woman-gothic-lace-dress-clasp-hands-together-say-thank_1258-114050.jpg?w=1480'],
    location: 'New York',
  },
  {
    id: 2,
    name: 'Lionel Messy',
    age: 28,
    pictures: ['https://img.freepik.com/premium-photo/image-happy-grateful-young-asian-woman-gothic-lace-dress-clasp-hands-together-say-thank_1258-114050.jpg?w=1480', 'https://img.freepik.com/premium-photo/image-happy-grateful-young-asian-woman-gothic-lace-dress-clasp-hands-together-say-thank_1258-114050.jpg?w=1480', 'https://img.freepik.com/premium-photo/image-happy-grateful-young-asian-woman-gothic-lace-dress-clasp-hands-together-say-thank_1258-114050.jpg?w=1480'],
    location: 'Los Angeles',
  },

  {
    id: 3,
    name: 'David Beckam',
    age: 30,
    pictures: ['https://img.freepik.com/premium-photo/image-happy-grateful-young-asian-woman-gothic-lace-dress-clasp-hands-together-say-thank_1258-114050.jpg?w=1480', 'https://img.freepik.com/premium-photo/image-happy-grateful-young-asian-woman-gothic-lace-dress-clasp-hands-together-say-thank_1258-114050.jpg?w=1480', 'https://img.freepik.com/premium-photo/image-happy-grateful-young-asian-woman-gothic-lace-dress-clasp-hands-together-say-thank_1258-114050.jpg?w=1480'],
    location: 'California',
  },  
  // Add more cards as needed
];

export default function App() {
  const handleYup = (card) => {
    console.log('Liked:', card);
  };

  const handleNope = (card) => {
    console.log('Disliked:', card);
  };

  return (
    <View style={{ flex: 1 }}>
      <SwipeCards
        cards={cards}
        renderCard={(cardData) => <Card {...cardData} />}
        renderNoMoreCards={() => <NoMoreCards />}
        handleYup={handleYup}
        handleNope={handleNope}
      />
    </View>
  );
}
